import logo from './logo.svg';
import './App.css';
function Header()
{
  return (
    <header className="header">
        <a href="#" class="logo">Portfolio.</a>

        <nav class="navbar">
            <a href="#">Home</a>
            <a href="#">About</a>
            <a href="#">Skills</a>
            <a href="#">Projects</a>
        </nav>
    </header>
  )
}



function App() {
  return (
    <div className='App'>
      <Header/>
    </div>
  );
}

export default App;
